}
/*Top*/
.top_container{
    width: 100%;
    height: auto;
    background-color: #fff;
    font-family: 'Open Sans', sans-serif;
    position: relative;
    z-index: 999;
    padding-top: 50px;
}
.wrapper .top{
    width: 100%;
    height: auto;
    font-family: 'Open Sans', sans-serif;
}
.wrapper .top .box1,
.wrapper .top .box2,
.wrapper .top .box3{
    display: inline-block;
    vertical-align: top;
    *display: inline;
    zoom: 1;
}
.wrapper .top .box1{
    width: 15%;
}
.wrapper .top .box1 .logo{
    display: block;
    width: 110px;
    height: auto;
    background-repeat: no-repeat;
    margin: 5px;
}
.wrapper .top .box1 .logo img{
    width: 150px;
}
.wrapper .top .box2{
    width: 69%;
}
.wrapper .top .box2 .top_menu{
    margin: 30px 0px;
    padding: 0px;
    text-transform: uppercase;
    font-size: 15px;
}
.wrapper .top .box2 .top_menu ul{
    margin: 15px 0px 0px 20px;
    padding: 0;
}
.wrapper .top .box2 .top_menu ul li{
    margin: 0px 40px 0px 0px;
    padding: 0;
    display: inline-block;
}
.wrapper .top .box2 .top_menu ul li a{
    margin: 0;
    padding: 0;
    text-decoration: none;
    color: #333;
}
.wrapper .top .box3{
    width: 14%;
}
.wrapper .top .box3 img{
    display: none;
}
/*Top End*/


/*Main Menu*/
.main_menu_wrapper{
    display: none;
    background-color: #fff;
    width: 100%;
    height: auto;
    position: relative;
    z-index: 99;
    box-shadow: 0 1px 5px 0 rgba(0, 0, 0, 0.25);
}   
.main_menu_wrapper .main_menu{
    margin: 0;
    padding: 0;
}
.main_menu_wrapper .main_menu ul{
    margin: 0;
    padding: 10px 0px 10px 0px;
}
.main_menu_wrapper .main_menu ul li{
    margin: 0px 0px 15px 0px;
    padding: 0px 20px;
    list-style: none;
    display: block;
}
.main_menu_wrapper .main_menu ul li a{
    margin: 0px 0px 10px 0px;
    padding: 0;
    color: #333;
    font-family: 'Oswald', sans-serif;
    font-size: 20px;
}
.main_menu_wrapper .main_menu ul li a:hover{
    color: #000;
}
/*Main Menu End*/

/* Main Container*/
.wrapper .main_container{
    min-height: 100px;
    background-color: #fff;
    width: 100%;
    padding: 0px 0px 40px;
    margin: 0px 0px 20px;
